An array of data points for the series. For the `sankey` series type,
points can be given in the following way:

An array of objects with named values. The objects are point
configuration objects as seen below. If the total number of data
points exceeds the series' [turboThreshold](#series.area.turboThreshold),
this option is not available.

 ```js
    data: [{
        from: 'Category1',
        to: 'Category2',
        weight: 2
    }, {
        from: 'Category1',
        to: 'Category3',
        weight: 5
    }]
 ```

The minimum size for a pie in response to auto margins. The pie will
try to shrink to make room for data labels in side the plot area,
 but only to this size.

Fires when an area of the chart has been selected. Selection is enabled
by setting the chart's zoomType. One parameter, `event`, is passed
to the function, containing common event information. The default action for the selection event is to
zoom the chart to the selected area. It can be prevented by calling
`event.preventDefault()`.

Information on the selected area can be found through `event.xAxis`
and `event.yAxis`, which are arrays containing the axes of each dimension
and each axis' min and max values. The primary axes are `event.xAxis[0]`
and `event.yAxis[0]`. Remember the unit of a datetime axis is milliseconds
since 1970-01-01 00:00:00.

<pre>selection: function(event) {
    // log the min and max of the primary, datetime x-axis
    console.log(
        Highcharts.dateFormat('%Y-%m-%d %H:%M:%S', event.xAxis[0].min),
        Highcharts.dateFormat('%Y-%m-%d %H:%M:%S', event.xAxis[0].max)
    );
    // log the min and max of the y axis
    console.log(event.yAxis[0].min, event.yAxis[0].max);
}</pre>

Options for configuring markers for annotations.

An example of the arrow marker:
<pre>
{
  arrow: {
    id: 'arrow',
    refY: 5,
    refX: 5,
    markerWidth: 10,
    markerHeight: 10,
    children: [{
      tagName: 'path',
      attrs: {
        d: 'M 0 0 L 10 5 L 0 10 Z',
        strokeWidth: 0
      }
    }]
  }
}
</pre>

Language object. The language object is global and it can't be set
on each chart initiation. Instead, use `Highcharts.setOptions` to
set it before any chart is initialized.

<pre>Highcharts.setOptions({
    lang: {
        months: [
            'Janvier', 'Fvrier', 'Mars', 'Avril',
            'Mai', 'Juin', 'Juillet', 'Aot',
            'Septembre', 'Octobre', 'Novembre', 'Dcembre'
        ],
        weekdays: [
            'Dimanche', 'Lundi', 'Mardi', 'Mercredi',
            'Jeudi', 'Vendredi', 'Samedi'
        ]
    }
});</pre>

Callback JavaScript function to format the label. The value is given
by `this.value`. Additional properties for `this` are `axis`, `chart`,
`isFirst` and `isLast`. The value of the default label formatter
can be retrieved by calling `this.axis.defaultLabelFormatter.call(this)`
within the function.

Defaults to:

<pre>function() {
    return this.value;
}</pre>

CSS styles for each label. To position the label, use left and top
like this:

<pre>style: {
    left: '100px',
    top: '100px'
}</pre>

An array of configuration objects for the buttons.

Defaults to

<pre>buttons: [{
    type: 'month',
    count: 1,
    text: '1m'
}, {
    type: 'month',
    count: 3,
    text: '3m'
}, {
    type: 'month',
    count: 6,
    text: '6m'
}, {
    type: 'ytd',
    text: 'YTD'
}, {
    type: 'year',
    count: 1,
    text: '1y'
}, {
    type: 'all',
    text: 'All'
}]</pre>

Fires when clicking on the rangeSelector button. One parameter, event,
is passed to the function, containing common event information.
<pre>
click: function(e) {
  console.log(this);
}
</pre>

Return false to stop default button's click action.
